import UIKit

//Given a string s and an integer k, return the maximum number of vowel letters in any substring of s with length k.
//
//Vowel letters in English are 'a', 'e', 'i', 'o', and 'u'.
//
// 
//
//Example 1:
//
//Input: s = "abciiidef", k = 3
//Output: 3
//Explanation: The substring "iii" contains 3 vowel letters.
//Example 2:
//
//Input: s = "aeiou", k = 2
//Output: 2
//Explanation: Any substring of length 2 contains 2 vowels.
//Example 3:
//
//Input: s = "leetcode", k = 3
//Output: 2
//Explanation: "lee", "eet" and "ode" contain 2 vowels.
// 
//
//Constraints:
//
//1 <= s.length <= 105
//s consists of lowercase English letters.
//1 <= k <= s.length

class Solution {
    func maxVowels(_ s: String, _ k: Int) -> Int {
        let vowels: Set<Character> = ["a", "e", "i", "o", "u"]
        let chars = Array(s)
        
        var maxVowelsCount = chars[0..<k].reduce(0) { count, char in
            count + (vowels.contains(char) ? 1 : 0)
        }
        var currentMaxVowelsCount = maxVowelsCount
    
        for index in k..<s.count {
            if vowels.contains(chars[index - k]) {
                currentMaxVowelsCount -= 1
            }
            
            if vowels.contains(chars[index]) {
                currentMaxVowelsCount += 1
            }
            
            maxVowelsCount = max(maxVowelsCount, currentMaxVowelsCount)
        }
        return maxVowelsCount
    }
}

let solution = Solution()
print(solution.maxVowels("leetcode", 3))
print(solution.maxVowels("", 3945))
